function() {

  function replaceParam(key, newKey, sourceURL) {
    var rtn = sourceURL.split("?")[0],
        param,
        params_arr = [],
        queryString = (sourceURL.indexOf("?") !== -1) ? sourceURL.split("?")[1] : "";
    if (queryString !== "") {
        params_arr = queryString.split("&");
        for (var i = params_arr.length - 1; i >= 0; i -= 1) {
            param = params_arr[i].split("=")[0];
          	var value = params_arr[i].split("=")[1];
            if (param === key) {
                params_arr.splice(i, 1);
              	params_arr.push(newKey+"="+value);
            }
        }
        rtn = rtn + "?" + params_arr.join("&");
    }
    return rtn;
	}
  var q = {{url - url query - global}}.length ? '&' + {{url - url query - global}} : '';  
  q = decodeURIComponent(q);
  var newQ = q.length ? '?' + q.replace(/&[^&@]+@[^&]+/g, '').substring(1) : '';

	if ({{dlv - page.category.pageType - global}} != "Storefinder" && {{dlv - page.category.pageType - global}} != "Search"){
      newQ = replaceParam("s","sc", newQ);
	}
  return newQ.length <= 1 ? '' : newQ;
}

