// Require the necessary APIs
const gtm_addEventCallback = require('addEventCallback');
const gtm_readFromDataLayer = require('copyFromDataLayer');
const gtm_sendPixel = require('sendPixel');
const gtm_getTimestamp = require('getTimestamp');
const gtm_log = require('logToConsole');

// Get the dataLayer event that triggered the tag
const gtm_event = gtm_readFromDataLayer('event');

// Add a timestamp to separate events named the same way from each other
const gtm_eventTimestamp = gtm_getTimestamp();

gtm_log('dataLayer: ', gtm_readFromDataLayer);

const gtm_endPoint = data.endPoint;
const gtm_hostName = data.hostName;
const gtm_dataLayer = data.dataLayer;
const gtm_batchHits = data.batchHits === 'yes';
const gtm_maxTags = data.maxTags;
const gtm_tagName = data.tagName;

// Utility for splitting an array into multiple arrays of given size
function gtm_splitToBatches(arr, size) {
const newArr = [];
for (let i = 0; i < arr.length; i += size) {
newArr.push(arr.slice(i, i + size));
}
return newArr;
}

// The addEventCallback gets two arguments: container ID and a data object with an array of tags that fired
gtm_addEventCallback(function(ctid, eventData) {
// Filter out tags that have the "exclude" metadata set to true
const tags = [];
for (let i = 0; i < eventData.tags.length; i++) {
const tag = eventData.tags[i];
if (tag.exclude !== 'true') {
tags.push(tag);
}
}
// If batching is enabled, split the tags into batches of the given size
const gtm_batches = gtm_batchHits ? gtm_splitToBatches(tags, gtm_maxTags) : [tags]; 
// For each batch, build a payload and dispatch to the endpoint as a GET request
for (let i = 0; i < gtm_batches.length; i++) {
const gtm_batch = gtm_batches[i];
let gtm_payload = '?tagName=' + gtm_tagName + '&eventName=' + gtm_event + '&eventTimestamp=' + gtm_eventTimestamp + '&hostName=' + gtm_hostName;
for (let j = 0; j < gtm_batch.length; j++) {
const tag = gtm_batch[j];
const gtm_tagPrefix = '&tag' + (j + 1);
gtm_payload +=
gtm_tagPrefix + 'id=' + tag.id +
gtm_tagPrefix + 'nm=' + tag.name +
gtm_tagPrefix + 'st=' + tag.status +
gtm_tagPrefix + 'et=' + tag.executionTime;
}
gtm_payload += '&dataLayer=' + gtm_dataLayer;
gtm_sendPixel(gtm_endPoint + gtm_payload, null, null);
}
});
// After adding the callback, signal tag completion
data.gtmOnSuccess();


